import math

def solve_quadratic(a, b, c):
    """"""
    D = b ** 2 - 4 * a * c
    if D < 0:
        return 'No real solutions.'
    elif D == 0:
        return [-b / (2 * a)]
    else:
        x1 = (-b + math.sqrt(D)) / (2 * a)
        x2 = (-b - math.sqrt(D)) / (2 * a)
        return [x1, x2]
